import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { Auth0Provider } from '@auth0/auth0-react';

const domain = "dev-rb7h2zv1l2rb2ysz.us.auth0.com";
const clientId = "03mm5T3PAz4NEprAmQTPYXGTeNx891Io";

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <Auth0Provider
    domain={domain}
    clientId={clientId}
    authorizationParams={{ redirect_uri: window.location.origin }}
    cacheLocation="localstorage"        // optional, recommended for SPA refresh
    useRefreshTokens={true}             // optional, recommended for SPA refresh
  >
    <App />
  </Auth0Provider>
);
